import mongoose from "mongoose";

const userSchema = new mongoose.Schema(
    {
        name: {
          type: String,
          required: true,
          trim: true,
        },
        email: {
          type: String,
          required: true,
          unique: true,
        },
        password: {
          type: String,
          required: true,
        },
        image: {
          type: String,
          default:"data:image/png;base64,"
        },
        address: {
          type: Object,
          default:{
            line:'',
            line2:'',
          }
        },
        gender:{
            type: String,
            default:"Not Selected"
        },
        dob:{
            type: String,
            default:"Not Selected"
        },
        phone:{
            type: String,
            default:"0000000000"
        }

      },{minimize:false}
);

const User = mongoose.model("User", userSchema);

export default User;
